import React, { Fragment } from 'react'
import { Link } from 'react-router-dom'

export default function Leftbar() {
  return (
    <React.Fragment>
    <div>
      <ul>
        <li><Link to="/">Home</Link></li>
      </ul>
    </div>
    </React.Fragment>
  )
}
